        "id": "5ea87ba036a8ca22933cd815",
        "name": "Daily To Do",
        "desc": "Do you find it hard to keep track of what's to do, what you've done and when? This template will help!\n\n------------------------------------------\n\nThis template uses Butler automation to help with your daily task management. \n\nFor guidance on how to set up Butler specifically for this template, please see: [Using Butler Automation with your Trello board](https://www.mfry.uk/trello-template-help \"Using Butler Automation with your Trello board\")\n\nHere is how to use it:\n\n1. Add tasks which you want to do into the **Backlog**. This could be tasks you want to complete today/tomorrow/next month etc.\n\n2. Each day, drag your tasks which you want to complete from the **Backlog** into **To Do Today**.\n\n3.  Once a task is done, move it to the **Done Today** List.\n\n**Simple!**\n\nWhere does Butler come on? Each day at 01:00 Butler will rename list **Done Today** to a new list with yesterday's date - so you can keep track of what you did when. A new **Done Today** list will be created. (_Note: You'll need to set up these Butler rules on your new board._)\n \n\n\n---\n\n**Extras**\n\nDaily tasks can be created in the **Daily Tasks** list. These are copied each day into the **To Do Today** list.\n\nIf a task in the **Backlog** has a due date and it's tomorrow then this task will automatically move into the **To Do Today** list. \n\n",
